require 'uri'
require 'net/http'

url = URI("https://www.virustotal.com/api/v3/files")

http = Net::HTTP.new(url.host, url.port)
http.use_ssl = true

request = Net::HTTP::Post.new(url)
request["accept"] = 'application/json'
request["x-apikey"] = '4fe8a3a6a41b79ced5a55201e606fe074d93105ac1570b9f61395b7b8d16a1f6'
request["content-type"] = 'multipart/form-data; boundary=---011000010111000001101001'
request.body = "-----011000010111000001101001\r\nContent-Disposition: form-data; name=\"file\"; filename=\"Appelli%20BIAR%20def.xlsx\"\r\nContent-Type: application/vnd.openxmlformats-officedocument.spreadsheetml.sheet\r\n\r\ndata:application/vnd.openxmlformats-officedocument.spreadsheetml.sheet;name=Appelli%20BIAR%20def.xlsx;base64,\r\n-----011000010111000001101001--"

response = http.request(request)
puts response.read_body